import string

polymer = ""


def are_opposite(a, b):
    return a != b and a.lower() == b.lower()


def react_polymer(input_polymer):
    stack = []
    for index in range(0, len(input_polymer)):
        current = input_polymer[index]
        if len(stack) == 0:
            stack.append(current)
        else:
            previous = stack.pop()
            if not are_opposite(previous, current):
                stack.append(previous)
                stack.append(current)
    return stack


def run_05a():
    print(len(react_polymer(polymer)))


def run_05b():
    minimum = len(react_polymer(polymer))
    for letter in string.ascii_lowercase:
        reduced_polymer = "".join([polymer[i] for i in range(0, len(polymer)) if polymer[i].lower() != letter])
        reduced_stack = react_polymer(reduced_polymer)
        print(f"With letter {letter}/{letter.upper()} removed : {len(reduced_stack)}")